import React, {Component} from 'react';

class Header extends Component{
  render(){
    return(
      <div>
          <nav className="navbar navbar-inverse">
              <a className="navbar-brand" href="#"> Bài 2 Components </a>
              <ul className="nav navbar-nav">
                  <li className="active">
                      <a href="#">Trang chủ</a>
                  </li>
                  <li>
                      <a href="#">Danh mục sản phẩm</a>
                  </li>
              </ul>
          </nav>
          
      </div>
    )
  }
}
